import styles from "../css/App.module.css";
import cappuccino from "../img/menu-cappuccino.jpg";
import { Link } from "react-router-dom";

function FormOfMenu() {
  return (
    <div className={styles.menu_div}>
      <li>
        <Link to={`/menu-detail`}>
          <img src={cappuccino} alt="coffeeImg" />
        </Link>
      </li>
      <span>아메리카노</span>
    </div>
  );
}
export default FormOfMenu;
